.highlight.linter-warning .region {
  background: linear-gradient(to bottom, #d28b71 0%, rgba(210, 139, 113, 0.30000000000000004) 20%, rgba(210, 139, 113, 0.30000000000000004) 80%, #d28b71 100%);
  border-left: 2px solid #d28b71;
  border-right: 2px solid #d28b71;
}
.highlight.linter-error .region {
  background: linear-gradient(to bottom, #cb6077 0%, rgba(203, 96, 119, 0.30000000000000004) 20%, rgba(203, 96, 119, 0.30000000000000004) 80%, #cb6077 100%);
  border-left: 2px solid #cb6077;
  border-right: 2px solid #cb6077;
}
